<html>
<head>
<style>
body, html, hr {margin: 0px; padding: 0px; background: rgb(32, 34, 39);}
h1 {position: relative; top:15%;color: white;}

#chat_container {margin: 5px; overflow: auto;padding-bottom: 5px;}
.top{background: rgb(43, 45, 49); display: flex; flex-flow: row nowrap; justify-content: left; align-content: left; align-items: left; border-bottom: solid 1px black;}
.item{ flex: 1 1 auto;}
.sickens_message_div, .adrians_message_div {padding: 5px; margin: 5px; border-radius: 15px; width: 300px;}
.sickens_message_div {;margin-left: 5px; margin-right: auto; background: rgb(129,90,156);border: solid 1px rgb(129,90,156)}
.adrians_message_div {margin-right: 5px; margin-left: auto; background: rgb(19,122,127);border: solid 1px rgb(19,122,127)}
.horizontal_container {min-width: 100%; width: 100%}
</style>
<script>
st=1000;
function scroll() {
  chat_container=document.getElementById('chat_container');
  chat_container.scrollTop=st;
  st+=1000;
}
function add_adrians_message(message) {
  horizontal=document.createElement('div');
  horizontal.classList.add("horizontal_container");
  adrians=document.createElement('div');
  adrians.classList.add('adrians_message_div');
  horizontal.appendChild(adrians);
  p=document.createElement('p');
  p.innerHTML=message;
  p.classList.add('adrians_message_p');
  adrians.appendChild(p);
  chat_container=document.getElementById('chat_container').appendChild(horizontal);
  scroll();
}

function add_sickens_message(message) {
  horizontal=document.createElement('div');
  horizontal.classList.add("horizontal_container");
  adrians=document.createElement('div');
  adrians.classList.add('sickens_message_div');
  horizontal.appendChild(adrians);
  p=document.createElement('p');
  p.innerHTML=message;
  p.classList.add('sickens_message_p');
  adrians.appendChild(p);
  chat_container=document.getElementById('chat_container').appendChild(horizontal);
  scroll();
}

addEventListener("resize", onresize);
function onresize(e) {
  document.getElementById('chat_container').style.height=window.innerHeight-120;
};
</script>
</head>
